  const handleClick = (e) => {
    // e.preventDefault();
    console.log(e);
    setRating(e.target.value);

    console.log(`The rating ${rating} was clicked`);
    if (book && rating){
      // ratingServices.addRatingToDb(book, rating);
    }
  };

  return(
    <Rating
      name="hover-feedback"
      defaultValue="3"
      precision={0.5}
      onChange={(event, newValue) => {
        handleClick(newValue);
      }}
    />
  )
};

export default BookRating;
